import React, { useState } from 'react';

const TilingLab = () => {
  const [M, setM] = useState('');
  const [N, setN] = useState('');
  const [numberOfWays, setNumberOfWays] = useState(null);

  const handleMChange = (event) => {
    setM(event.target.value);
  };

  const handleNChange = (event) => {
    setN(event.target.value);
  };

  const calculateWays = () => {
    const m = parseInt(M, 10);
    const n = parseInt(N, 10);

    if (!isNaN(m) && !isNaN(n) && m >= 2 && m <= n && n <= 50) {
      const ways = (m === n) ? m : n - m + 2;
      setNumberOfWays(ways);
    } else {
      setNumberOfWays('Неправильні дані');
    }
  };

  return (
    <div className="container">
      <h1>Лабораторна робота 2</h1>
      <h2>Умова задачі:</h2>
      <p>Прямокутний коридор довжиною N метрів та шириною M метрів вирішили
        застелити N прямокутними плитками шириною 1 метр та довжиною M метрів,
        таким чином, щоб не було не застеленої поверхні.
        Потрібно написати програму, яка знайде кількість способів зробити це.
        Наприклад, для коридору з розмірами 6 на 4 є чотири способи застелити плитками
        1 на 4.</p>
      <h2>Вхідні дані</h2>
      <p>Вхідний файл INPUT.TXT містить два цілих числа – M (довжина плитки та
        ширина коридору) та N (довжина коридору). Для цих чисел правильні нерівності
        2 ≤ M ≤ N ≤ 50</p>
      <h2>Вихідні дані:</h2>
      <p>Вихідний файл OUTPUT.TXT повинен містити одне число – кількість
        способів</p>
        <h2>Приклад:</h2>
      <p>INPUT: 4 6</p>
      <p>OUTPUT: 4</p>
      
      <form>
        <div className="form-group">
          <label htmlFor="MInput">M:</label>
          <input type="number" value={M} onChange={handleMChange} className="form-control" id="MInput" />
        </div>
        <div className="form-group">
          <label htmlFor="NInput">N:</label>
          <input type="number" value={N} onChange={handleNChange} className="form-control" id="NInput" />
        </div>
        <button type="button" onClick={calculateWays} className="btn">Обчислити</button>
      </form>

      {numberOfWays !== null && (
        <div className="form-group">
          <label htmlFor="Output">Результат:</label>
          <input type="text" value={numberOfWays} className="form-control" id="Output" readOnly />
        </div>
      )}
    </div>
  );
};

export default TilingLab;
